import React from "react";
import projects from "../data/projects";
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();
  // Chỉ lấy 3 dự án đầu tiên (nổi bật)
  const featured = projects.filter(p => p.status === "active").slice(0, 3);
  return (
    <div style={{ maxWidth: 800, margin: "40px auto", background: "rgba(255,255,255,0.10)", borderRadius: 18, boxShadow: "0 2px 12px 0 rgba(25, 118, 210, 0.10)", padding: 40 }}>
      <h2 style={{ textAlign: "center", marginBottom: 32, color: "#ffd600" }}>Dự án nổi bật</h2>
      {featured.map(project => (
        <div key={project.id} style={{ display: "flex", alignItems: "flex-start", border: "1px solid #ddd", borderRadius: 12, padding: 20, marginBottom: 24, background: "rgba(255,255,255,0.08)", boxShadow: "0 2px 8px 0 rgba(25, 118, 210, 0.04)", color: "#fff" }}>
          <img
            src={project.image}
            alt={project.name}
            style={{ width: 120, height: 90, objectFit: "cover", borderRadius: 8, marginRight: 20, boxShadow: "0 1px 4px 0 rgba(25, 118, 210, 0.10)" }}
          />
          <div style={{ flex: 1 }}>
            <h3 style={{ margin: 0, color: "#ffd600", fontWeight: 700 }}>{project.name}</h3>
            <p style={{ margin: "8px 0 8px 0", color: "#ffd600" }}>{project.description}</p>
            <p style={{ margin: 0, color: "#ffd600" }}><b>Mục tiêu:</b> {project.targetAmount} MTK</p>
            <button
              style={{
                marginTop: 12,
                padding: "8px 18px",
                background: "#d32f2f",
                color: "#fff",
                border: "none",
                borderRadius: 6,
                cursor: "pointer",
                fontWeight: 600,
                boxShadow: "0 1px 4px 0 rgba(211,47,47,0.10)",
                transition: "background 0.2s, box-shadow 0.2s, transform 0.18s"
              }}
              onClick={() => navigate(`/donate/${project.id}`)}
            >
              Quyên góp
            </button>
          </div>
        </div>
      ))}

      <div style={{ textAlign: "center", margin: "32px 0" }}>
        <button
          style={{ padding: "10px 32px", background: "#ffd600", color: "#222", border: "none", borderRadius: 8, fontWeight: 700, fontSize: 18, cursor: "pointer", boxShadow: "0 2px 8px 0 rgba(25, 118, 210, 0.08)" }}
          onClick={() => navigate("/all-projects")}
        >
          Xem tất cả dự án cần quyên góp
        </button>
      </div>

      <div style={{ background: "rgba(255,255,255,0.10)", borderRadius: 12, padding: 24, marginBottom: 32 }}>
        <h2 style={{ color: "#ffd600", marginBottom: 12 }}>Về chúng tôi</h2>
        <p style={{ color: "#fff", fontSize: 17 }}>
          Chúng tôi là nền tảng kết nối cộng đồng nhằm hỗ trợ các dự án từ thiện, giúp đỡ trẻ em, người yếu thế và bảo vệ môi trường. Sứ mệnh của chúng tôi là lan tỏa yêu thương và tạo ra giá trị bền vững cho xã hội.
        </p>
      </div>

      <div style={{ background: "rgba(255,255,255,0.10)", borderRadius: 12, padding: 24 }}>
        <h2 style={{ color: "#ffd600", marginBottom: 12 }}>Liên hệ</h2>
        <p style={{ color: "#fff", fontSize: 17 }}>
          Email: lienhe@charityapp.vn<br />
          Hotline: 0123 456 789<br />
          Địa chỉ: 123 Đường Từ Thiện, Quận 1, TP.HCM
        </p>
      </div>
    </div>
  );
}

export default Home;
